from collections import defaultdict

class Solution:
    def validPalindrome(self, s):
        """
        :type s: str
        :rtype: bool
        """
        
        def valid_palindrome_helper(i, j):
            if i >= j:
                return True
            
            if valid_palindrome[i][j] is None:
                if s[i] == s[j]:
                    valid_palindrome[i][j] = valid_palindrome_helper(i+1, j-1)
                else:
                    valid_palindrome[i][j] = valid_palindrome_helper(i+1, j) or valid_palindrome_helper(i, j-1)
            return valid_palindrome[i][j]
        valid_palindrome = [[None] * len(s) for _ in range(len(s))]
        return valid_palindrome_helper(0, len(s)-1)

s = ""
print(Solution().validPalindrome(s))
